              className="img"
            ></img>
          </Carousel.Item> */}

          <Carousel.Item interval={2000}>
            <Carousel.Caption></Carousel.Caption>
            <img
              src={require("D:/Final_Project/PGDAC/PGDAC-Final-E-Learning-Frontend/my-app/src/Pages/images/elearning1.jpg")}
              className="img"
            ></img>
          </Carousel.Item>

          <Carousel.Item interval={2000}>
            <Carousel.Caption></Carousel.Caption>
            <img
              src={require("D:/Final_Project/PGDAC/PGDAC-Final-E-Learning-Frontend/my-app/src/Pages/images/e_learning.webp")}
              className="img"
            ></img>
          </Carousel.Item>

          {/* <Carousel.Item interval={2000}>
            <Carousel.Caption></Carousel.Caption>
            <img
              src={require("D:/Final_Project/PGDAC/PGDAC-Final-E-Learning-Frontend/my-app/src/Pages/images/el.webp")}
              className="img"
            ></img>
          </Carousel.Item> */}
        </Carousel>
        <section id="home">
          <div className="container text-center">
            <div className="row justify-content-center">
              <div className='col-md-10'>
              <h1 className="text-white display-4">Best Online Home Service Providers In India</h1>
              <p className="text-white"> Experienced, hand-picked Professionals to serve you at your doorstep</p>
              </div></div>
          </div>
          </section>
      </div>
    </div>
  );
};

export default Home;
